import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

// #region constants

// #endregion

// #region styled-components

// #endregion

// #region functions

// #endregion

// #region component
const propTypes = {};

const defaultProps = {};

/**
 * 
 */
const footerMain = {
    backgroundColor: "black",
    padding: "20em",
    color: "white",
    position: "absolute",
    width: "100%",
    bottom: "0"
}

const Footer = () => {
    return <footer style={footerMain}>
        <FontAwesomeIcon style={{ color: "white" }} icon="fa-regular fa-share-nodes" />

    </footer>;
}

Footer.propTypes = propTypes;
Footer.defaultProps = defaultProps;
// #endregion

export default Footer;
